import React, { useRef, useState } from "react";
import "../Appointment/appont.css";
import { Dialog } from "primereact/dialog";
const Appoinment = () => {
  const [visible, setVisible] = useState(false);
  let Procedures = (e) => {
    e.preventDefault();
    setVisible(true);
    console.log("solg");
  };

  return (
    <>
      <h1 className="h1">Book your Appoinment</h1>
      <div className="appcontainer">
        {/* <form> */}
        <lable>name:</lable>
        <input type="text" />
        <br />
        <lable>age</lable>
        <input type="number" />
        <br />
        <lable>Email</lable>
        <input type="email" />
        <br />
        <lable>cause of vist</lable>
        <select aria-label="Default select example">
          {/* <option>ss</option> */}
          <option value="1">fever</option>
          <option value="2">cough</option>
          <option value="3">body pain</option>
          <option value="4">other</option>
        </select>
        <br />
        <div className="card flex justify-content-center">
          <button
            label="Show"
            icon="pi pi-external-link"
            onClick={() => setVisible(true)}
          />
          <Dialog
            header="Header"
            visible={visible}
            style={{ width: "50vw" }}
            onHide={() => setVisible(false)}
          >
            <p>vshbznznjznjzn</p>
          </Dialog>
        </div>

        <button onClick={() => Procedures} className="formsub">
          proceed
        </button>
        <Dialog
          header="Header"
          visible={visible}
          style={{ width: "50vw" }}
          onHide={() => setVisible(false)}
        >
          <p>vshbznznjznjzn</p>
        </Dialog>
        {/* </form> */}
      </div>
    </>
  );
};

export default Appoinment;
